import React, {useState} from 'react';
import axios from 'axios';


function App(){
    const [first, data] = useState('데이터 없음')
    const res = axios.get('/')
    data(res)

    return(
        <div className='App'>
            <h1> {first} </h1>

        </div>
    )
}

export default App;
